USE MASTER
GO

IF DB_ID('ACC_Store') IS NOT NULL
BEGIN
    DROP DATABASE ACC_Store
END

CREATE DATABASE ACC_Store
GO

USE ACC_Store 
GO

IF EXISTS (SELECT 1 FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_TYPE='BASE TABLE' AND TABLE_NAME='Employee') 
BEGIN
	ALTER TABLE dbo.Store DROP CONSTRAINT FK_Emp_ID 
	DROP TABLE dbo.Employee 
END

CREATE TABLE dbo.Employee (
	Emp_ID		INT		IDENTITY(1,1),
	First_Name	VARCHAR(50),
	MI			VARCHAR(5),
	Last_Name	VARCHAR(50),
	Address1	VARCHAR(100),
	Address2	VARCHAR(100),
	City		VARCHAR(50),
	State_CD	VARCHAR(2),
	Zip_code	VARCHAR(5),
	Zip_Ext		VARCHAR(4),
	Email		VARCHAR(100),
	Phone		VARCHAR(11),
	Active_IND	INT,
	CREATE_BY	VARCHAR(50),
	CREATE_DT	DATETIME,
	UPDATE_BY	VARCHAR(50),
	UPDATE_DT	DATETIME,
	CONSTRAINT	PK_Emp_ID	PRIMARY KEY	NONCLUSTERED (Emp_ID)
	)

IF EXISTS (SELECT 1 FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_TYPE='BASE TABLE' AND TABLE_NAME='Store') 
BEGIN
	ALTER TABLE dbo.Stock DROP CONSTRAINT FK_Store_ID 
	DROP TABLE dbo.Store
END

CREATE TABLE dbo.Store  (
	Store_ID	INT	IDENTITY(1,1),
	Store_Name	VARCHAR(100),
	Manager_ID	INT,
	Address1	VARCHAR(100),
	Address2	VARCHAR(100),
	City		VARCHAR(50),
	State_CD	VARCHAR(2),
	Zip_code	VARCHAR(5),
	Zip_Ext		VARCHAR(4),
	Email		VARCHAR(100),
	Phone		VARCHAR(11),
	Active_IND	INT,
	CREATE_BY	VARCHAR(50),
	CREATE_DT	DATETIME,
	UPDATE_BY	VARCHAR(50),
	UPDATE_DT	DATETIME,
	CONSTRAINT	PK_Store_ID	PRIMARY KEY NONCLUSTERED (Store_ID),
	CONSTRAINT	FK_Emp_ID FOREIGN KEY (Manager_ID) REFERENCES dbo.Employee(Emp_ID)
	)

IF EXISTS (SELECT 1 FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_TYPE='BASE TABLE' AND TABLE_NAME='Product') 
BEGIN
	ALTER TABLE dbo.Stock DROP CONSTRAINT FK_Product_ID 
	DROP TABLE dbo.Product
END

CREATE TABLE dbo.Product  (
	Product_ID		INT	IDENTITY(1,1),
	Product_Name	VARCHAR(100),
	Price			DECIMAL(18,2),
	Active_IND		INT,
	CREATE_BY		VARCHAR(50),
	CREATE_DT		DATETIME,
	UPDATE_BY		VARCHAR(50),
	UPDATE_DT		DATETIME,
	CONSTRAINT	PK_Product_ID	PRIMARY KEY NONCLUSTERED (Product_ID)
	)

IF EXISTS (SELECT 1 FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_TYPE='BASE TABLE' AND TABLE_NAME='Stock') 
	DROP TABLE dbo.Stock

CREATE TABLE dbo.Stock  (
	Stock_ID	INT	IDENTITY(1,1),
	Store_ID	INT,
	Product_ID	INT,
	Quantity	VARCHAR(100),
	Active_IND	INT,
	CREATE_BY	VARCHAR(50),
	CREATE_DT	DATETIME,
	UPDATE_BY	VARCHAR(50),
	UPDATE_DT	DATETIME,
	CONSTRAINT	PK_Stock_ID	PRIMARY KEY NONCLUSTERED (Stock_ID),
	CONSTRAINT	FK_Store_ID FOREIGN KEY (Store_ID) REFERENCES dbo.Store(Store_ID),
	CONSTRAINT	FK_Product_ID FOREIGN KEY (Product_ID) REFERENCES dbo.Product(Product_ID)
	)


-------------------------------------------- DATA TIME -----------------------------------------------
IF (SELECT COUNT(Emp_ID) FROM dbo.Employee) > 0
BEGIN
	ALTER TABLE dbo.Store DROP CONSTRAINT FK_Emp_ID 
	TRUNCATE TABLE dbo.Employee
	ALTER TABLE dbo.Store ADD CONSTRAINT FK_Emp_ID FOREIGN KEY (Manager_ID) REFERENCES dbo.Employee(Emp_ID)

END



IF (SELECT COUNT(Store_ID) FROM dbo.Store) > 0
BEGIN
	TRUNCATE TABLE dbo.Store
END


IF (SELECT COUNT(Product_ID) FROM dbo.Product) > 0
BEGIN
	ALTER TABLE dbo.Stock DROP CONSTRAINT FK_Product_ID 
	TRUNCATE TABLE dbo.Product 
	ALTER TABLE dbo.Stock ADD CONSTRAINT FK_Product_ID FOREIGN KEY (Product_ID) REFERENCES dbo.Product(Product_ID)
END


IF (SELECT COUNT(Stock_ID) FROM dbo.Stock) > 0
BEGIN
	TRUNCATE TABLE dbo.Stock
END


UPDATE dbo.Employee
SET Active_IND = 1,
	CREATE_BY = SUSER_SNAME(),
	CREATE_DT = GETDATE(),
	UPDATE_BY = SUSER_SNAME(),
	UPDATE_DT = GETDATE()

UPDATE dbo.Product
SET Active_IND = 1,
	CREATE_BY = SUSER_SNAME(),
	CREATE_DT = GETDATE(),
	UPDATE_BY = SUSER_SNAME(),
	UPDATE_DT = GETDATE()

UPDATE dbo.Store
SET Active_IND = 1,
	CREATE_BY = SUSER_SNAME(),
	CREATE_DT = GETDATE(),
	UPDATE_BY = SUSER_SNAME(),
	UPDATE_DT = GETDATE()

UPDATE dbo.Stock
SET Active_IND = 1,
	CREATE_BY = SUSER_SNAME(),
	CREATE_DT = GETDATE(),
	UPDATE_BY = SUSER_SNAME(),
	UPDATE_DT = GETDATE()
